Full_Description:
The Program Data Analyst supports the goals of the Data, Strategy and Evaluation (DSE) Department around the development and execution of a data strategy to execute data analytics and impact reporting and to strengthen our program data systems. Responsibilities include data management, data analytics, documentation of policies and procedures, database administration, and program evaluation support. This position requires strong analytical skills, attention to detail, ability to multi-task in a fast-paced and changing environment.
ESSENTIAL DUTIES AND RESPONSIBILITIES include the following. Other duties can be assigned, and the duties and responsibilities of the job are subject to change without notice.
Conduct regular program reporting and analyses to assess performance, and effectively communicate results across the organization.
Analyze data sets (e.g. program data, fundraising data, publicly available data, etc.), using a variety of analytical tools to unlock insights, measure effectiveness and use data to inform decision-making
Collect, organize, and clean data collected internally in the organization, asking the right questions to address issues raised by stakeholders
Support the administration of the Salesforce and Efforts to Outcomes (ETO) Programs databases, including managing user accounts, answering staff questions, monitoring data entry timeliness and quality, de-duping records and keeping up-to-date with new features
Support the development and adoption of data visualizations through automated dashboards
Assist on Programs data system implementation and migration projects, including researching solutions and best practices, business process improvement planning, documentation of policy and procedures, data migration and cleaning, and training
Support the monitoring and evaluation of programs, including database support, data entry and quality assistance as needed, logistics, training and coordination with program staff, survey administration, focus group facilitation, and documentation
Support qualitative data collection processes such as client surveys or focus groups, both through direct client interactions and volunteer coordination, as well as analysis to produce reports on client demographics and impact
Pull ad hoc data and fact check data used in grant proposals, reports, presentations and communications materials
Consolidate data statistics from published research sources and create digestible summaries for various stakeholders
QUALIFICATIONS:
Analytical Skills: ability to analyze and synthesize data using a variety of data analysis tools.
Problem Solver: uses rigorous logic and methods to solve difficult problems with effective solutions; is intellectually curious; strong critical thinker.
Detail oriented: ability to successfully manage all aspects of projects with the highest degree of professionalism and attention to detail.
Planning Skills: excellent organization; attention to details; proven ability to multi-task; meets deadlines; measures performance against goals.
Action Oriented: results driven; ability to adapt based on changing priorities and lessons learned; delivers high quality products.
Interpersonal skills: ability to work independently and collaboratively; widely trusted; able to interact effectively with a variety of stakeholders including colleagues, volunteers, clients and other community members
Cultural Humility: work effectively across cultures; demonstrates a commitment to learning, communicating and working respectfully with people different from themselves.
Commitment to the mission and values of GLIDE.
EDUCATION and/or EXPERIENCE:
BA degree and 2+ years of experience, preferably in a non-profit environment, or an equivalent combination of education and experience;
CERTIFICATES, LICENSES, REGISTRATIONS:
None
COMMUNICATION SKILLS:
Strong writing, editing and proofreading skills;
Ability to research, analyze, compose and communicate written and verbal reports;
Ability to relay data to non-technical audiences.
MATHEMATICAL SKILLS:
Ability to interpret and analyze statistical data.
COMPUTER SKILLS:
Proficiency with MS Office with advanced level capability in Excel;
Experience in database management concepts preferred;
Previous CRM experience required,with Salesforce experience strongly preferred;
Experience with Efforts to Outcomes (ETO) preferred;
Experience with statistical, graphical, and data science software, such as R, Python or Tableau a plus.
